<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=edge"/>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>web-ADMIN-user-overlay</title>
<link rel="stylesheet" type="text/css" id="applicationStylesheet" href="web_ADMIN_user_overlay.css"/>
<script id="applicationScript" type="text/javascript" src="web_ADMIN_user_overlay.js"></script>
</head>
<body>
<div id="web_ADMIN_user_overlay">
	<div id="user_overlay">
		<svg class="dim_back">
			<rect fill="rgba(49,49,49,1)" id="dim_back" rx="0" ry="0" x="0" y="0" width="1920" height="975">
			</rect>
		</svg>
		<svg class="white_back">
			<rect fill="rgba(255,255,255,1)" id="white_back" rx="25" ry="25" x="0" y="0" width="169" height="268">
			</rect>
		</svg>
		<div id="BLOOD_v1_0_0">
			<span>BLOOD v1.0.0</span>
		</div>
		<div id="logout_btn" class="logout_btn">
			<svg class="logout_rect">
				<rect fill="rgba(255,255,255,1)" id="logout_rect" rx="0" ry="0" x="0" y="0" width="169" height="47">
				</rect>
			</svg>
			<div id="logout_content">
				<div id="Logout">
					<span>Logout</span>
				</div>
				<img id="logout_grey" src="logout_grey.png" srcset="logout_grey.png 1x, logout_grey@2x.png 2x">
			</div>
		</div>
		<svg class="l4" viewBox="0 0 143 1">
			<path fill="transparent" stroke="rgba(49,49,49,1)" stroke-width="1px" stroke-linejoin="miter" stroke-linecap="butt" stroke-miterlimit="4" shape-rendering="auto" id="l4" d="M 0 0 L 143 0">
			</path>
		</svg>
		<div id="about_btn" class="about_btn">
			<svg class="Rectangle_106">
				<rect fill="rgba(255,255,255,1)" id="Rectangle_106" rx="0" ry="0" x="0" y="0" width="169" height="47">
				</rect>
			</svg>
			<div id="about_content">
				<div id="About_us">
					<span>About us</span>
				</div>
				<img id="programming_GREY" src="programming_GREY.png" srcset="programming_GREY.png 1x, programming_GREY@2x.png 2x">
			</div>
		</div>
		<svg class="l3" viewBox="0 0 143 1">
			<path fill="transparent" stroke="rgba(49,49,49,1)" stroke-width="1px" stroke-linejoin="miter" stroke-linecap="butt" stroke-miterlimit="4" shape-rendering="auto" id="l3" d="M 0 0 L 143 0">
			</path>
		</svg>
		<div id="setting_btn" class="setting_btn">
			<svg class="setting_rect">
				<rect fill="rgba(255,255,255,1)" id="setting_rect" rx="0" ry="0" x="0" y="0" width="169" height="47">
				</rect>
			</svg>
			<div id="setting_content">
				<div id="Settings">
					<span>Settings</span>
				</div>
				<img id="settings_grey" src="settings_grey.png" srcset="settings_grey.png 1x, settings_grey@2x.png 2x">
			</div>
		</div>
		<svg class="l4_cy" viewBox="0 0 143 1">
			<path fill="transparent" stroke="rgba(49,49,49,1)" stroke-width="1px" stroke-linejoin="miter" stroke-linecap="butt" stroke-miterlimit="4" shape-rendering="auto" id="l4_cy" d="M 0 0 L 143 0">
			</path>
		</svg>
		<div id="user_status">
			<svg class="admin_rect">
				<rect fill="rgba(255,255,255,1)" id="admin_rect" rx="0" ry="0" x="0" y="0" width="169" height="47">
				</rect>
			</svg>
			<div id="user_ADMIN">
				<span>ADMIN</span>
			</div>
			<img id="overlaysuit" src="overlaysuit.png" srcset="overlaysuit.png 1x, overlaysuit@2x.png 2x">
		</div>
		<svg class="l1" viewBox="0 0 103 1">
			<path fill="transparent" stroke="rgba(49,49,49,1)" stroke-width="1px" stroke-linejoin="miter" stroke-linecap="butt" stroke-miterlimit="4" shape-rendering="auto" id="l1" d="M 0 0 L 103 0">
			</path>
		</svg>
		<div id="admin_user">
			<span>KIRAN</span>
		</div>
	</div>
</div>
</body>
</html>
